   play_pulse(freq, start_time, dur, volume) {
    //console.log(ok);
    let osc = audioCtx.createOscillator();
    osc.type = 'sine';
    osc.frequency.value = freq;

    let amp = audioCtx.createGain();
    amp.gain.setValueAtTime(0, audioCtx.currentTime);
    amp.gain.linearRampToValueAtTime(volume, audioCtx.currentTime + 0.05);
    //amp.gain.linearRampToValueAtTime(0,audioCtx.currentTime + 3 - 0.01);



    let lfo = audioCtx.createOscillator();
    lfo.type = 'square';
    lfo.frequency.value = 10;

    lfo.connect(amp.gain);
    let biquadFilter = audioCtx.createBiquadFilter();
    biquadFilter.type = "lowpass";
    biquadFilter.frequency.setValueAtTime(500, audioCtx.currentTime + start_time);
    osc.connect(biquadFilter).connect(amp).connect(audioCtx.destination);
    lfo.start(audioCtx.currentTime + start_time);
    osc.start(audioCtx.currentTime + start_time);
    lfo.stop(audioCtx.currentTime + start_time + dur);
    osc.stop(audioCtx.currentTime + start_time + dur);
  }

